import React from "react";

class WishlistPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      wishlist: [],
    };
  }

  addToWishlist = (item) => {
    this.setState({
      wishlist: [...this.state.wishlist, item],
    });
  };

  render() {
    return (
      <div>
        <h1>Wishlist</h1>
        <ul>
          {this.state.wishlist.map((item, index) => (
            <li key={index}>
              {item.title} - {item.price}
            </li>
          ))}
        </ul>
      </div>
    );
  }
}

export default WishlistPage;
